import React from "react";
import "./Meme.css"

function Meme(props) {
    return(
        <div id="imagewrap" class="wrap" >
    <img src="https://i.imgur.com/EFM76Qe.jpg?1" id="img_prev"  />
    <h3 class="desc">Something <br /><span>Inspirational</span></h3>
    <span id="wow">WOW!</span>
  </div>
    );
}

export default Meme;
